import React, { Component } from 'react';
import './App.css';
import MediaPlayer from './MediaPlayer/Media-Player'


class App extends Component {

  constructor() {
    super();
    this.state = {
      serverURL: 'https://frozen-thicket-30265.herokuapp.com/downloadmp3?url=',
      watchLink: 'https://www.youtube.com/watch?v=kfhufYmqqaM'
    }
  }

  render() {
    return (
      <div className="App">
        <MediaPlayer/>
      </div>
    );
  }
}

export default App;
